import React, { useEffect, useState } from 'react';

import DateFnsUtils from '@date-io/date-fns';
import {
    MuiPickersUtilsProvider,
    KeyboardDatePicker,
} from '@material-ui/pickers';import Icon from '@material-ui/core/Icon';

export function C_DatePicker(props) {

    var style = props.style ? props.style : {};

    function onChange(e){
        if(props.onChange)
            props.onChange(e);
    }

    return (
        <div style={{ display: "flex", alignItems: "center" }}>
            <Icon style={{ marginRight: 7 }} color={props.color ? props.color : "primary"}>{props.icon}</Icon>
            <MuiPickersUtilsProvider utils={DateFnsUtils}>                <KeyboardDatePicker
                    disableToolbar
                    variant="inline"
                    format="MM/dd/yyyy"
                    margin="normal"
                    id="date-picker-inline"
                    label="Date picker inline"
                    value={props.value ? props.value : new Date()}
                    onChange={onChange}
                    KeyboardButtonProps={{
                        'aria-label': 'change date',
                    }}
                />
            </MuiPickersUtilsProvider>
        </div>
    )
}
